本商品はお取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。誠に恐れ入りますが、何卒ご了承ください。<br>また、以下の場合には追加送料がかかる場合がございます。<br><br>・沖縄、離島および一部地域への配送時<br>・同梱区分が異なる商品の複数購入時<br><br>【出荷目安】：<b>1 - 4営業日　※土日・祝除く</b><br>【同梱区分】：<b>TS 1</b><br>【梱包サイズ】：<b>通常商品</b><br><br><br><hr><br><font color="red"><b>商品内容</b></font><br><br>マルチパフォーマンスで使いやすいスタンダードモデル。第四世代IntelR Core i5-4460プロセッサーを搭載し、生産性を向上します。IntelR HD Graphics4600を内蔵しておりグラフィックス性能を向上します。スーパーマルチ光学ドライブ搭載、多くのDVDフォーマットに対応。不正アクセスからPCやHDDを保護する多彩なセキュリティを専用画面で手軽に行えるエイサー独自のProshildを搭載。TPM1.2セキュリティチップ搭載、認証情報やプラットフォームの安全対策を保管することが可能。伝送速度1Gbpsのギガビット・イーサネットに対応した通信機能を搭載。シリアルポートなど、多彩なポートを備えた拡張しやすいインターフェース設計。OSはWindows7 Professional 32 bit (SP1) / Windows 7 Professional 64 bit (SP1)(Windows 10 Pro ライセンスからのダウングレード)。※初回起動時はWindows 7 Professional32bit。Windows 7 Professional 64bitを使用するためにはハードディスクリカバリが必要となります。Windows 10 Pro 64bitを使用するためには付属のディスクからリカバリが必要となります。<br><br><hr><br><font color="red"><b>商品スペック</b></font><br><br>インストールOS詳細    Win7Pro 32bit(SP1)/Win7Pro64bit(SP1)(Windows10Proからのダウングレード)/Windows10Pro64bit*初回起動時はWindows7Pro32bitがプリロード。Win7Pro64bitを使用するにはハードディスクリカバリー。Win10Pro64bitトを使用するには付属のディスクからリカバリー。<br>ライセンスOS    Windows 10 Pro 64ビット<br>CPU詳細    インテル Core i5-4460プロセッサー、3.20GHz(インテルターボ・ブースト・テクノロジー2.0対応:最大3.40GHz)、キャッシュ 6MB (メイン・プロセッサーに内蔵)<br>プロセッサーテクノロジー    -<br>チップセット    インテル H81 Express チップセット <br>メインメモリ(標準)    4GB<br>メインメモリ(最大)    16GB<br>メモリタイプ    DDR3L-1600MHz SDRAM / DIMM， デュアルチャンネル対応可能、4GBx1<br>メモリスロット(空/全)    1/2<br>ストレージ容量    500GB<br>ストレージタイプ    HDD:7200rpm、Serial ATA<br>光学ドライブ    DVD スーパーマルチドライブ<br>その他ドライブ    なし<br>ドライブベイ(空/全)    5.25インチ 光学ドライブベイ x1 (空き x0)、3.5インチ HDドライブベイ x1 (空き x0)<br>グラフィックコントローラ    インテル HDグラフィックス4600(メイン・プロセッサに内蔵)<br>VRAM容量    最大1538MB(メイン・メモリーと共用/32ビットOS使用時)<br>ディスプレイ詳細    なし<br>ディスプレイサイズ    -<br>解像度    -<br>タッチパネル    非搭載<br>外部ディスプレイ出力    あり:DVI-D 出力ポート x1:1920x1200， アナログVGA (ミニ D-Sub 15ピン)出力ポートx1:1920x1200<br>メモリカードスロット    あり:SDカードリーダー<br>PCI-Expressスロット    あり:PCI Express 2.0 X16スロット [ロープロファイル版] x1 (空き x1)、PCI Express2.0 X1スロット [ロープロファイル版] x1 (空きx1) *すべてのオプションの動作を保証するものではありません。<br>有線LAN    1000Base-T/100Base-TX/10Base-T 準拠(Wake-on-LAN対応)<br>無線LAN    なし<br>その他無線データ転送    なし<br>USB    USB3.0x2 (前面x2)、USB2.0x6 (前面x2・背面x4)、<br>その他インターフェース    フロント:マイクロフォン・ジャック x1、ヘッドフォン・ジャック 1・バック:イーサネット(RJ-45)ポートx1、オーディオポート x3(マイク入力、ライン・イン、ライン・アウト)、PS/2キーボードポート x1、PS/2マウスポートx1、シリアルポートx1<br>TVチューナー    なし<br>キーボード    あり:USBキーボード(JIS標準配列)・109A・テンキーあり<br>ポインティングデバイス    あり:USB光学マウス<br>スピーカー    なし<br>Webカメラ    なし<br>オフィスソフト    Microsoft Office Personal 2016<br>その他ソフト    -<br>本体サイズ(H×W×D)    266.5x101.5x396.8<br>本体重量    5500<br>電源    220W (100V-240V、50/60Hz)<br>最大消費電力    220W<br>最大消費電力(備考)    -<br>標準消費電力    30.7W<br>スリープ時消費電力    1.51W<br>その他節電関連    -<br>温湿度条件、最高動作高度    操作時:5℃-35℃、非操作時:-20℃-65℃、湿度:操作時・非操作時:20%-80%(ただし結露が発生しないこと)<br>附属品    USB光学マウス、マウスパッド、USBキーボード、電源ケーブル、Windows 10 Proリカバリーディスク、セットアップガイド、保証書、Addendum (付録: リカバリーに関する説明)、ユーザーガイド(楽楽acer)、修理依頼書<br>リカバリ用データ保存場所    HDD<br>注意事項    リカバリメディアはWindows 10Proのみ添付。32ビットOSでは仕様により使用可能な領域は最大約3GBとなります。最大メモリー容量にする場合、標準実装されているメモリーを交換する必要があります。ユーザーによるメモリー交換は保証対象外となる場合があります。<br>その他スペック    TPM (TCG V1.2準拠)、カバー・ロック用タブ、ケンジントン・ロック用取り付け穴、IE 11<br>グリーン購入法    対応<br>PCグリーンラベル    不適合<br>国際エネルギースター    登録(2009年7月発効の基準)<br>GPN(グリーン購入ネットワーク)    未登録<br>エコリーフ    未登録<br>VCCI    対応<br>PCリサイクル    対応<br>エネルギー消費効率    U区分 0.058 (AAA)[2011年度省エネ基準達成率]<br>RoHS指令    対応<br>J-Moss    対応<br>電波法    非対象<br>電波法備考    無線デバイスなし<br>電気通信事業法    非対象<br>電気通信事業法備考    無線デバイスなし<br>電気用品安全法    適合<br>電気用品安全法備考    電源ケーブル<br>法規関連確認日    20160404<br>その他環境及び安全規格    -<br>CO2排出量    211.992kg/年<br><br><style TYPE="text/css">
